import React from "react";
import PropTypes from "prop-types";
import Loading from "../Loding";

const ExchangePresenter = ({ exchange, loading }) => {
  if (loading) {
    return <Loading />;
  } else {
    return exchange.map((ex) => (
      <div key={ex.id}>
        <div>
          {ex.name} 
        </div>
        <div>
          {ex.description} 
        </div>
        <div>
          {ex.links.website} 
        </div>
      </div>
    ));
  }
};

export default ExchangePresenter;
